import React, { useState } from 'react';

export default function App() {
  // Define state for user information
  const [user, setUser] = useState({
    Name: 'Pradeep Birla',
    Age: 25,
    phone: 9587452145,
  });

  // Function to handle changes in user input
  const handleChange = (e) => {
    const { name, value } = e.target;
    setUser((prevUser) => ({
      ...prevUser,
      [name]: value,
    }));
  };

  return (
    <>
      <div>
        <span>Your Name</span>
        <input
          type='text'
          name='Name'
          value={user.Name} // Display user's name
          onChange={handleChange} // Handle name change
        />
        <span>Your Age</span>
        <input
          type='text'
          name='Age'
          value={user.Age} // Display user's age
          onChange={handleChange} // Handle age change
        />
        <span>Your Mobile Number</span>
        <input
          type='text'
          name='phone'
          value={user.phone} // Display user's phone
          onChange={handleChange} // Handle phone change
        />
      </div>
    </>
  );
}
